import { useCartContext } from "./context/CartContext.jsx";



const Cart = () => {
  const {cart} = useCartContext()
  

  const estoImprime = () => {
    console.log('esete es el carrito ',cart);
  }
  
  return (
    <div className="grid grid-cols-4 gap-4">
      {
        
 
          <>
            {
              
              cart.map((cart) => {
                
                return (
                  <div key={cart.id} className="flex justify-center grid-cols-4">
                    <li>{cart.name}</li>
                
                    
                  </div>
                );
              })
            }
          </>
} 
      
    </div>
  );
}
export default Cart
